void graphicsBlackScreen() {
	ST7735_FillRect(0,0,120,160,0x0000);
}

void graphicsMainScreen() {
	graphicsBlackScreen();
	//print Braille Reader Bitmap
	ST7735_DrawBitmap(5,70,aviator,120,70);
	//print number of message
	
	ST7735_SetCursor(6,10);
	char* string = "You have ";
	ST7735_OutString((uint8_t*)string);
	ST7735_OutChar((char)messageFifoSize()+48);
	ST7735_SetCursor(4,12);
	string = " new messages.";
	ST7735_OutString((uint8_t*)string);
}

void graphicsPrintCharacter(char letter, Braille braille) {
	ST7735_SetCursor(10,6);
	ST7735_SetTextColor(0x07E0);
	ST7735_OutChar(letter);
	
	ST7735_FillRect(0, 70, 120, 150, 0x0000);
	
	if(braille.output[0]) {
    ST7735_DrawBitmap(40, 90, dot, 12, 12);
	}
	if(braille.output[1]) {
    ST7735_DrawBitmap(70,90, dot, 12, 12);
	}
	if(braille.output[2]) {
    ST7735_DrawBitmap(40, 120, dot, 12, 12);
	}
	if(braille.output[3]) {
    ST7735_DrawBitmap(70, 120, dot, 12, 12);
	}
	if(braille.output[4]) {
    ST7735_DrawBitmap(40, 150, dot, 12, 12);
	}
	if(braille.output[5]) {
    ST7735_DrawBitmap(70, 150, dot, 12, 12);
	}
}
